    @Test
    fun `generate hl7 with intentional note paragraphs`() {
        val note = """potato
            |many potatoes
            |even more potatoes
        """.trimMargin()
        val hl7 = MDMService().generateMDM("Test", mdmPatientFields, mdmPractitionerFields, note, "202206011250")

        val context: HapiContext = DefaultHapiContext()
        context.validationContext = ValidationContextFactory.defaultValidation()
        val parser: Parser = context.pipeParser
        val message = parser.parse(hl7.first)
        val terser = Terser(message)
        assertEquals(terser.get("/OBSERVATION(1)/OBX-5"), "many potatoes")
        assertEquals(terser.get("/OBSERVATION(2)/OBX-5"), "even more potatoes")
    }

    @Test
    fun `do not populate non MRN, FHIR ids`() {
        val note = """test note"""
        val hl7 = MDMService().generateMDM("Test", mdmPatientFields, mdmPractitionerFields, note, "202206011250")
        val context: HapiContext = DefaultHapiContext()
        context.validationContext = ValidationContextFactory.defaultValidation()
        val parser: Parser = context.pipeParser
        val message = parser.parse(hl7.first)
        val terser = Terser(message)
        val id = terser.getSegment("PID").getField(3)
        for (i in id.indices) {
            assertTrue(terser.get("/PID-3($i)") in listOf("123456", "654321"))
            assertFalse(terser.get("/PID-3($i)") in listOf("987-65-4321", "randomid"))
        }
    }

    @Test
    fun `respect passed in documentStatus`() {
        val note = """test note"""
        val hl7 =
            MDMService().generateMDM("Test", mdmPatientFields, mdmPractitionerFields, note, "202206011250", null, "IP")
        val context: HapiContext = DefaultHapiContext()
        context.validationContext = ValidationContextFactory.defaultValidation()
        val parser: Parser = context.pipeParser
        val message = parser.parse(hl7.first)
        val terser = Terser(message)
        val status = terser.getSegment("TXA").getField(17, 0) as ID
        assertEquals("IP", status.value)
    }
